window.bookSummaryJSON = "<p>Her powers can make the elements change...but Elena will never change how the Fae see her. </p> <p>Half-breed. The lowest of low. Halven, the forbidden offspring produced by the mating of a Fae and a human. </p> <p>The only thing Fae despise more than Halven—well, nothing. </p> <p>When a deadly virus sweeps their world, killing immortal Fae, a secret about a royal bloodline is revealed. </p> <p>The half-breed holds the key to their survival. </p> <p>And on her 18th birthday, Elena discovers a world of warring Faery kingdoms and her fateful place in it...among her enemies. </p> <p>If only she could unlock her powers. </p> <p>With no one to trust, she turns to the beautiful, brilliant boy next door. But Derek has secrets of his own. </p> <p>He’s a half-breed like her. And his father is the cruel king who wants Elena dead. At all costs. </p> <p>The last in line of a powerful Fae, she refuses to use her magic for those who hate her. But when she discovers her mother is still alive, she'll do whatever it takes to earn her mother’s freedom. </p> <p>Even agree to help the enemy.</p>"; 
